desktopweb.customCSS:
cursor: pointer !important;
border-top: 1px solid rgba(144,96,183,0.2);
border-right: 1px solid rgba(144,96,183,0.2);
border-bottom: 1px solid rgba(144,96,183,0.2);
-moz-border-radius-topleft: 3px;	
border-top-left-radius: 3px;
